function getFullNum(num) {
    if (num > 9)
        return num.toString();
    else
        return '0' + num.toString();
}
function toastInfo(input) {
    toast(input);
    console.info(input);
}
function toastWarn(input) {
    toast(input);
    console.warn(input);
}
function toastError(input) {
    toast(input);
    console.error(input);
}
function setTimer() {
    rawInput('填报时间,手机号码,途经省市：', getFullNum(runAt.getHours()) + ':' + getFullNum(runAt.getMinutes()) + ',' + phone + ',' + track, input => {
        if (input === null)
            return;
        let params = input.split(',');
        if (params.length !== 3) {
            toastWarn('格式不正确，将使用默认值。');
        }
        else {
            let timeInput = params[0];
            if (new RegExp(/^(?:(?:[0-2][0-3])|(?:[0-1][0-9])):[0-5][0-9]$/).test(timeInput)) {
                runAt.setHours(timeInput.split(':')[0]);
                if (timeInput === '00:00')
                    runAt.setMinutes(parseInt(timeInput.split(':')[1]) + 1);
                else if (timeInput === new Date().toTimeString().substring(0, 5)) {
                    if (timeInput.substring(3, 5) === '59') {
                        if (timeInput === '23:59') {
                            runAt.setHours(0);
                            runAt.setMinutes(1);
                        }
                        else {
                            runAt.setHours(parseInt(timeInput.split(':')[0]) + 1);
                            runAt.setMinutes(0);
                        }
                    }
                    else
                        runAt.setMinutes(parseInt(timeInput.split(':')[1]) + 1);
                }
                else
                    runAt.setMinutes(timeInput.split(':')[1]);
            }
            else
                toastWarn('时间格式不正确，将使用默认值 07:00 或最后一次正确设置的值。');
            let phoneInput = params[1];
            if (new RegExp(/^[1][3|4|5|7|8][0-9]{9}$/).test(phoneInput)) {
                phone = phoneInput;
            }
            else
                toastWarn('手机号码格式不正确，将使用默认值 13456765431 或最后一次正确设置的值。');
            let trackInput = params[2];
            if (trackInput.length >= 2 && trackInput.length <= 20) {
                track = trackInput;
            }
            else
                toastWarn('途经省市格式不正确，将使用默认值“黑龙江省哈尔滨市”或最后一次正确设置的值。');
        }
        complete = false;
        storage.put('settings', { runAt: { hour: runAt.toTimeString().substring(0, 2), minute: runAt.toTimeString().substring(3, 5) }, phone: phone, track: track });
        toastInfo('设置填报时间为 ' + runAt.toTimeString().substring(0, 5) + '。');
    });
}
