let storage = storages.create('life.his2nd.autofillin2');
let settings = storage.get('settings');
let runAt = new Date();
runAt.setHours(7);
runAt.setMinutes(0);
runAt.setSeconds(0);
let phone = '13456765431';
let track = '黑龙江省哈尔滨市';
if (typeof settings === 'undefined')
    storage.put('settings', { runAt: { hour: runAt.toTimeString().substring(0, 2), minute: runAt.toTimeString().substring(3, 5) }, phone: phone, track: track });
else {
    let h = parseInt(settings.runAt.hour);
    let m = parseInt(settings.runAt.minute);
    let now = new Date().toTimeString().substring(0, 5);
    let hNow = parseInt(now.split(':')[0]);
    let mNow = parseInt(now.split(':')[1]);
    if (h === hNow && m === mNow) {
        if (m === 59) {
            if (h === 23) {
                runAt.setHours(0);
                runAt.setMinutes(1);
            }
            else {
                runAt.setHours(h + 1);
                runAt.setMinutes(0);
            }
        }
        else {
            runAt.setHours(h);
            runAt.setMinutes(m + 1);
        }
    }
    else {
        runAt.setHours(h);
        runAt.setMinutes(m);
    }
    if (typeof settings.phone !== 'undefined') {
        phone = settings.phone;
    }
    if (typeof settings.track !== 'undefined') {
        track = settings.track;
    }
}
let running = false;
let complete = false;
